import './App.css';
import Tile from './Tile.js'

function App() {
  return (
    <>
      <Tile name='Animals' image='cat' isFolder={true} ></Tile>
      <Tile name='Animals' image='carpet' isFolder={true} ></Tile>
    </>
  );
}

export default App;
